export default function Homepage() {

    const styleSheet = {
        about: {
            border: "2px black solid",
            backgroundColor: "#fca80e82",
            width: "50dvw",
            height: "50dvh",
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            textAlign: "center"
        }
    }

    return (
        <section style={styleSheet.about}>
            <h1>Who am I?</h1>
            <p>I'm just a guy from California. I find joy in the small things of life, such as Hiking, Skating, 3d Art, and anything to do with computers. I have spent the past couple years teaching web development while traveling. </p>
        </section>
    )
}
